'use strict';
let MessageType = require('./MessageType.js');
let AccountCommissionsList = require('./AccountCommissionsList.js');
class GetAccountCommissionsMessage {
    accountCommissionsList;
    acctId;
    offerIds;
    constructor() {
        this.accountCommissionsList = new AccountCommissionsList();
        this.acctId = null;
        this.offerIds = [];
    }
    getAccountCommissions() {
        return this.accountCommissionsList.toArray();
    }
    getType() {
        return MessageType.GetAccountCommissions;
    }
    getAcctId() {
        return this.acctId;
    }
    getOfferIds() {
        return this.offerIds;
    }
}
module.exports = GetAccountCommissionsMessage
